(20, 'Moderna dự đoán thời điểm đại dịch Covid-19 kết thúc', 'moderna-du-doan-thoi-diem-dai-dich-covid-19-ket-thuc', 'upload/news/avatar/benhvienngaepa-1638591667343.jpg', '<p>Chủ tịch h&atilde;ng vaccine Moderna đ&atilde; đưa ra dự b&aacute;o về t&igrave;nh h&igrave;nh đại dịch Covid-19 trong năm 2022 khi biến chủng Omicron vẫn đang b&ugrave;ng ph&aacute;t.</p>', '<p><img alt=\"\" src=\"/upload/images/benhvienngaepa-1638591667343.jpg\" style=\"height:514px; width:770px\" /></p>\r\n\r\n<p>&quot;Năm 2022 c&oacute; thể l&agrave; năm m&agrave; đại dịch bước v&agrave;o giai đoạn bệnh đặc hữu, nhưng điều đ&oacute; c&ograve;n phụ thuộc v&agrave;o những g&igrave; xảy ra tr&ecirc;n thực tế v&agrave; c&aacute;c quyết định được đưa ra tr&ecirc;n to&agrave;n thế giới&quot;, Chủ tịch&nbsp;ki&ecirc;m người đồng s&aacute;ng lập Moderna&nbsp;Noubar Afeyan cho biết trong một cuộc phỏng vấn với&nbsp;<em>Bloomberg</em>&nbsp;h&ocirc;m 14/1.</p>\r\n\r\n<p>Theo tiến sĩ Afeyan, mặc d&ugrave; Omicron c&oacute; khả năng l&acirc;y nhiễm cao, nhưng biến chủng n&agrave;y &iacute;t c&oacute; nguy cơ g&acirc;y bệnh nặng hơn.</p>\r\n\r\n<p>&Ocirc;ng Afeyan cũng cho biết, mũi vaccine tăng cường của Moderna nhằm ngăn ngừa biến chủng Omicron c&oacute; thể được thử nghiệm tr&ecirc;n người trong v&agrave;i tuần tới. Gi&aacute;m đốc điều h&agrave;nh Moderna Stephane Bancel cũng đưa ra tuy&ecirc;n bố tương tự v&agrave;o đầu tuần n&agrave;y.</p>\r\n\r\n<p>&quot;Ch&uacute;ng t&ocirc;i sẽ sẵn s&agrave;ng với qu&aacute; tr&igrave;nh thử nghiệm bắt đầu sau v&agrave;i tuần nữa. Liệu ch&uacute;ng ta cần một mũi vaccine tăng cường v&agrave;o m&ugrave;a xu&acirc;n hơn, hay v&agrave;o m&ugrave;a thu, l&agrave; điều m&agrave; ch&uacute;ng t&ocirc;i sẽ phải l&agrave;m việc với c&aacute;c quan chức tr&ecirc;n to&agrave;n&nbsp;<a href=\"https://dantri.com.vn/the-gioi.htm\">thế giới</a>&nbsp;để t&igrave;m ra c&acirc;u trả lời&quot;, tiến sĩ Afeyan cho biết th&ecirc;m.</p>\r\n\r\n<p>&Ocirc;ng Bancel dự đo&aacute;n sẽ cần một mũi vaccine tăng cường kh&aacute;c v&agrave;o m&ugrave;a thu v&agrave; c&oacute; khả năng chứa th&agrave;nh phần ph&ugrave; hợp với Omicron. Th&aacute;ng 11/2021, &ocirc;ng Bancel từng n&oacute;i rằng vaccine&nbsp;Covid-19&nbsp;c&oacute; thể kh&ocirc;ng hiệu quả với biến chủng Omicron nếu so s&aacute;nh với chủng Delta trước đ&oacute;.</p>\r\n\r\n<p>Th&aacute;ng 9/2021, &ocirc;ng Bancel dự đo&aacute;n dịch&nbsp;Covid-19&nbsp;c&oacute; thể kết th&uacute;c trong năm 2022. Doanh nh&acirc;n n&agrave;y cho rằng, v&agrave;o thời điểm đ&oacute;, hoạt động sản xuất ra c&aacute;c chế phẩm chống dịch sẽ được đẩy mạnh đủ để cung ứng cho to&agrave;n thế giới.</p>\r\n\r\n<p>&Ocirc;ng Afeyan năm ngo&aacute;i cho biết Moderna từ khởi điểm con số 0 đ&atilde; c&oacute; thể sản xuất một tỷ liều vaccine&nbsp;Covid-19&nbsp;trong v&ograve;ng chưa đầy một năm. &quot;T&ocirc;i nghĩ ch&uacute;ng t&ocirc;i c&oacute; thể mở rộng sản xuất từ một tỷ đến 3 tỷ liều v&agrave;o năm 2022&quot;, &ocirc;ng Afeyan n&oacute;i hồi th&aacute;ng 10/2021.</p>\r\n\r\n<p>Hơn 2 năm kể từ khi&nbsp;đại dịch Covid-19&nbsp;b&ugrave;ng ph&aacute;t, thế giới vẫn đang chật vật đối ph&oacute; với đợt b&ugrave;ng ph&aacute;t mới do sự xuất hiện của c&aacute;c biến chủng mới. Biến chủng Omicron được ph&aacute;t hiện hồi cuối năm 2021 ở ch&acirc;u Phi đang khiến số ca nhiễm mới ở nhiều nơi tr&ecirc;n thế giới tăng đột biến, k&eacute;o theo th&aacute;ch thức lớn cho hệ thống y tế.</p>\r\n\r\n<p>Tuy nhi&ecirc;n, giới chuy&ecirc;n gia dự đo&aacute;n&nbsp;<a href=\"https://dantri.com.vn/suc-khoe/dai-dich-covid-19.htm\">Covid-19</a>&nbsp;c&oacute; thể trở th&agrave;nh bệnh đặc hữu trong năm 2022, hay n&oacute;i c&aacute;ch kh&aacute;c l&agrave; kh&ocirc;ng c&ograve;n g&acirc;y mối đe dọa đ&aacute;ng kể cho thế giới.</p>\r\n\r\n<p>&quot;2022 l&agrave; năm&nbsp;<a href=\"https://dantri.com.vn/suc-khoe/dai-dich-covid-19.htm\">đại dịch Covid-19</a>&nbsp;c&oacute; thể kết th&uacute;c. Giờ đ&acirc;y, ch&uacute;ng ta đ&atilde; c&oacute; c&aacute;c c&ocirc;ng cụ c&oacute; thể l&agrave;m giảm mức độ nghi&ecirc;m trọng của căn bệnh n&agrave;y&quot;, b&agrave; Maria Van Kerkhove, Trưởng nh&oacute;m kỹ thuật phụ tr&aacute;ch Covid-19 của Tổ chức Y tế Thế giới (WHO), nhận định. Dự đo&aacute;n n&agrave;y được đưa ra dựa tr&ecirc;n t&iacute;nh to&aacute;n rằng, đến giữa năm 2022, c&aacute;c nước đều đạt được tỷ lệ ti&ecirc;m chủng &iacute;t nhất 70%.</p>\r\n\r\n<p>Đầu th&aacute;ng n&agrave;y, Đặc ph&aacute;i vi&ecirc;n về Covid-19 của WHO David Nabarro cũng cho rằng đại dịch sẽ c&ograve;n th&aacute;ch thức thế giới trong &iacute;t nhất 3 th&aacute;ng nữa, nhưng triển vọng chấm dứt đại dịch đ&atilde; ở ph&iacute;a trước. Trước đ&oacute;, Gi&aacute;m đốc WHO phụ tr&aacute;ch khu vực ch&acirc;u &Acirc;u Hans Kluge cảnh b&aacute;o, kh&ocirc;ng thể tuy&ecirc;n bố chấm dứt đại dịch khi hệ thống y tế vẫn c&oacute; nguy cơ kh&ocirc;ng thể đối ph&oacute; với số ca bệnh tăng đột biến.</p>\r\n\r\n<p>Nanette Cocero, chủ tịch to&agrave;n cầu của Pfizer Vaccines, hồi th&aacute;ng 12 năm ngo&aacute;i dự đo&aacute;n&nbsp;&quot;Covid-19 sẽ trở th&agrave;nh bệnh đặc hữu, c&oacute; khả năng v&agrave;o năm 2024&quot;. Trong khi đ&oacute;, Gi&aacute;m đốc khoa học của Pfizer Mikael Dolsten cho rằng thời gian Covid-19 chuyển th&agrave;nh bệnh đặc hữu c&oacute; thể thay đổi t&ugrave;y theo từng khu vực.</p>', 201, '2022-01-14 20:18:23', '2022-01-14 20:29:11'),
(21, 'Biến chủng Omicron ảnh hưởng thế nào tới trẻ em?', 'bien-chung-omicron-anh-huong-the-nao-toi-tre-em', 'upload/news/avatar/covidxinhua-1642153090694.jpg', '<p>Số trẻ em nhiễm bệnh v&agrave; nhập viện do biến chủng Omicron tr&ecirc;n thế giới đang tăng l&ecirc;n, khiến một số nước bắt đầu triển khai ti&ecirc;m chủng vaccine Covid-19 cho trẻ nhỏ.</p>', '<p><img alt=\"\" src=\"/upload/images/covidxinhua-1642153090694.jpg\" style=\"height:513px; width:770px\" /></p>\r\n\r\n<p>B&aacute;o&nbsp;<em>South China Morning Post (SCMP)</em>&nbsp;cho biết, số trẻ em nhiễm biến chủng Omicron tr&ecirc;n&nbsp;thế giới&nbsp;đang tăng nhanh trong khoảng một th&aacute;ng trở lại đ&acirc;y, bao gồm cả ở Trung Quốc. Tại Mỹ, dữ liệu từ Bệnh viện Nhi khoa cho thấy, trẻ em chiếm hơn 20% tổng số ca mắc được b&aacute;o c&aacute;o h&agrave;ng tuần trong tuần kết th&uacute;c v&agrave;o ng&agrave;y 23/12/2021. Trẻ em cũng chiếm 1,8% đến 4,1% tổng số ca nhập viện trong số 24 bang b&aacute;o c&aacute;o dữ liệu bệnh nhi mắc Covid-19.</p>\r\n\r\n<p>Tại th&agrave;nh phố New York, Tiến sĩ Mary Bassett, ủy vi&ecirc;n y tế bang cho hay: &quot;Số ca bệnh nhi mắc&nbsp;Covid-19&nbsp;đ&atilde; tăng gần 5 lần kể từ ng&agrave;y 11/12/2021. Trong v&ograve;ng tuần thứ 2 của th&aacute;ng 12/2021, 22 trẻ em phải nhập viện v&agrave;o c&aacute;c bệnh viện ở th&agrave;nh phố New York, nhưng chỉ một tuần tiếp theo số ca nhập viện điều trị đ&atilde; l&agrave; 109 trẻ. Tr&ecirc;n to&agrave;n bang trong c&ugrave;ng thời điểm, số ca nhập viện đ&atilde; tăng 2,5 lần, cụ thể từ 70 trẻ nhập viện l&ecirc;n th&agrave;nh 184 trẻ nhập viện&quot;.</p>\r\n\r\n<p><strong>Số ca nhiễm tăng, nhưng chủ yếu triệu chứng nhẹ</strong></p>\r\n\r\n<p>Gi&aacute;o sư Emily Chan Ying-yang Chan, Ph&oacute; trưởng khoa Dược Đại học Hong Kong (Trung Quốc), cho rằng chưa c&oacute; bằng chứng khoa học n&agrave;o cho thấy Omicron ảnh hưởng đến trẻ em nhiều hơn so với c&aacute;c biến chủng kh&aacute;c.</p>\r\n\r\n<p>Gi&aacute;o sư Terence Stephenson tại Viện Nhi khoa, Đại học London (Anh), nhận định: &quot;T&ocirc;i cho rằng, l&yacute; do khiến số trẻ em nhiễm Omicron ở nhiều nước tăng nhanh l&agrave; do tỷ lệ miễn dịch ở trẻ nhỏ thấp hơn so với người lớn&quot;.</p>\r\n\r\n<p>&quot;SARS-CoV-2 đang t&aacute;c động đến c&aacute;c cộng đồng lớn hơn v&agrave; chắc chắn t&aacute;c động đến trẻ em theo c&aacute;ch m&agrave; ch&uacute;ng t&ocirc;i chưa từng biết đến. V&agrave; hiện nay dường như SARS-CoV-2 đ&atilde; t&igrave;m thấy đối tượng th&iacute;ch hợp để l&acirc;y nhiễm, đ&oacute; l&agrave; những trẻ nhỏ chưa đủ điều kiện ti&ecirc;m chủng hoặc những đứa trẻ lớn hơn chưa được ti&ecirc;m chủng, hoặc ti&ecirc;m chủng kh&ocirc;ng đầy đủ&quot;, Tiến sĩ Juan Salazar, Gi&aacute;m đốc Trung t&acirc;m Nhi khoa Connecticut ở Hartford (Mỹ) cảnh b&aacute;o.</p>\r\n\r\n<p>Mặc d&ugrave; tỷ lệ nhiễm Omicron ở trẻ em đang tăng l&ecirc;n, nhưng chủ yếu c&aacute;c ca nhiễm bệnh c&oacute; triệu chứng nhẹ. &Ocirc;ng Terence Stephenson cho biết: &quot;Số ca nhiễm đang tăng cao, nhưng nguy cơ bệnh nặng rất thấp. Lấy Anh l&agrave;m v&iacute; dụ, chỉ c&oacute; khoảng 250 trẻ em phải điều trị t&iacute;ch cực, trong đ&oacute;, chỉ c&oacute; 20 trẻ kh&ocirc;ng c&oacute; bệnh nền&quot;. Một số dữ liệu ban đầu cho thấy, tỷ lệ nhập viện ở trẻ em nhiễm Omicron thậm ch&iacute; c&oacute; thể thấp hơn so với nhiễm Delta. Hiện c&aacute;c nh&agrave; khoa học đang theo d&otilde;i liệu trẻ c&oacute; mắc triệu chứng Covid-19 k&eacute;o d&agrave;i sau khi nhiễm biến chủng Omicron hay kh&ocirc;ng.</p>\r\n\r\n<p>Điều n&agrave;y cũng đặt ra c&acirc;u hỏi liệu trẻ c&oacute; n&ecirc;n ti&ecirc;m vaccine ngừa Covid-19 hay kh&ocirc;ng. Theo &ocirc;ng Stephenson, mặc d&ugrave; Omicron hiện chỉ g&acirc;y triệu chứng nhẹ cho trẻ em, nhưng &iacute;t nhiều n&oacute; cũng l&agrave;m ảnh hưởng đến đời sống h&agrave;ng ng&agrave;y của trẻ nhỏ. V&iacute; dụ, nếu trẻ nhiễm bệnh v&agrave; bị c&aacute;ch ly, điều n&agrave;y sẽ l&agrave;m gi&aacute;n đoạn sinh hoạt h&agrave;ng ng&agrave;y cũng như việc học tập. Do vậy, việc ti&ecirc;m chủng vaccine sẽ gi&uacute;p trẻ phần n&agrave;o tr&aacute;nh được sự gi&aacute;n đoạn n&agrave;y. Ngo&agrave;i ra, ti&ecirc;m chủng vaccine cũng thể gi&uacute;p ngăn trẻ l&acirc;y lan virus, truyền bệnh cho người cao tuổi hay những người thuộc nh&oacute;m nguy cơ cao.</p>\r\n\r\n<p>Mới đ&acirc;y, Tiến sĩ Anthony Fauci, chuy&ecirc;n gia dịch tễ h&agrave;ng đầu của Mỹ, cho biết ti&ecirc;m chủng vaccine Covid-19 c&oacute; thể giảm nguy cơ cho trẻ em c&oacute; bệnh nền.</p>', 201, '2022-01-14 20:25:41', '2022-01-14 20:28:49'),
(22, 'Người phụ nữ ngoại tình bị đánh 100 roi giữa nơi công cộng', 'nguoi-phu-nu-ngoai-tinh-bi-danh-100-roi-giua-noi-cong-cong', 'upload/news/avatar/nguoi-phu-nu-ngoai-tinh-bi-danh-100-roi-giua-noi-cong-cong-1-1642206756968.jpeg', '<p>Một phụ nữ ở tỉnh Aceh, Indonesia đ&atilde; bị đ&aacute;nh 100 roi v&igrave; tội ngoại t&igrave;nh, trong khi người đ&agrave;n &ocirc;ng kia phủ nhận mọi c&aacute;o buộc v&agrave; chỉ phải nhận 15 roi.</p>', '<p>&Ocirc;ng Ivan Najjar Alavi, người đứng đầu bộ phận điều tra chung tại văn ph&ograve;ng c&ocirc;ng tố ph&iacute;a đ&ocirc;ng tỉnh Aceh, cho biết t&ograve;a &aacute;n đ&atilde; tuy&ecirc;n một bản &aacute;n khắc nghiệt hơn cho người phụ nữ sau khi c&ocirc; th&uacute; nhận với c&aacute;c điều tra vi&ecirc;n rằng c&ocirc; đ&atilde; quan hệ t&igrave;nh dục ngo&agrave;i h&ocirc;n nh&acirc;n.</p>\r\n\r\n<p>C&aacute;c thẩm ph&aacute;n cảm thấy rất kh&oacute; để kết tội người đ&agrave;n &ocirc;ng - người đứng đầu một c&ocirc;ng ty về thủy hải sản ở ph&iacute;a đ&ocirc;ng tỉnh Aceh bởi v&igrave; anh ta phủ nhận mọi h&agrave;nh vi sai tr&aacute;i. Người đ&agrave;n &ocirc;ng n&agrave;y cũng đ&atilde; c&oacute;&nbsp;gia đ&igrave;nh&nbsp;ri&ecirc;ng.</p>\r\n\r\n<p>&quot;Trong phi&ecirc;n t&ograve;a, anh ta kh&ocirc;ng thừa nhận bất cứ điều g&igrave;, v&agrave; phủ nhận mọi c&aacute;o buộc. Do đ&oacute;, c&aacute;c thẩm ph&aacute;n kh&ocirc;ng thể chứng minh anh ta c&oacute; tội hay kh&ocirc;ng&quot; - &ocirc;ng Alavi cho biết sau khi c&ocirc;ng khai chỉ tr&iacute;ch những người vi phạm Luật Hồi gi&aacute;o h&ocirc;m 13/1.</p>\r\n\r\n<p>Tỉnh Aceh l&agrave; khu vực duy nhất ở Indonesia m&agrave; người d&acirc;n phần lớn theo đạo Hồi v&agrave; vẫn &aacute;p dụng Luật Hồi gi&aacute;o. Cụ thể l&agrave; ph&aacute;p luật cho ph&eacute;p đ&aacute;nh đ&ograve;n những người vi phạm c&aacute;c tội danh: cờ bạc, ngoại t&igrave;nh, uống rượu v&agrave; quan hệ t&igrave;nh dục đồng t&iacute;nh nam.</p>\r\n\r\n<p>Sau khi b&aacute;c bỏ mọi tội lỗi, người đ&agrave;n &ocirc;ng đ&atilde; được ph&aacute;n quyết tội &quot;thể hiện t&igrave;nh cảm với người phụ nữ kh&ocirc;ng phải vợ anh ta&quot;. Được biết, cặp đ&ocirc;i đ&atilde; bị bắt quả tang c&oacute; h&agrave;nh vi&nbsp;ngoại t&igrave;nh tại một đồn điền dầu cọ v&agrave;o năm 2018.</p>\r\n\r\n<p>Ban đầu, người đ&agrave;n &ocirc;ng n&agrave;y bị kết &aacute;n 30 roi, nhưng sau khi kh&aacute;ng c&aacute;o th&agrave;nh c&ocirc;ng ở t&ograve;a &aacute;n tối cao tỉnh Aceh, mức &aacute;n đ&atilde; giảm xuống c&ograve;n 15 roi.</p>\r\n\r\n<p>Theo một ph&oacute;ng vi&ecirc;n của tờ AFP c&oacute; mặt tại hiện trường, h&igrave;nh phạt d&agrave;nh cho người phụ nữ đ&atilde; bị tạm dừng bởi v&igrave; c&ocirc; kh&ocirc;ng thể chịu đựng nổi cơn đau.</p>\r\n\r\n<p>Trước đ&oacute;, một người đ&agrave;n &ocirc;ng bị kết tội quan hệ t&igrave;nh dục với trẻ vị th&agrave;nh ni&ecirc;n cũng bị đ&aacute;nh 100 roi. C&aacute;c c&ocirc;ng tố vi&ecirc;n cho biết, anh ta sẽ phải ngồi t&ugrave; 75 th&aacute;ng sau vụ đ&aacute;nh đ&ograve;n.</p>\r\n\r\n<p>H&agrave;ng chục người đ&atilde; chứng kiến, quay phim lại vụ việc v&agrave; chia sẻ l&ecirc;n mạng x&atilde; hội. Cảnh tượng n&agrave;y thường bị c&aacute;c nh&oacute;m nh&acirc;n quyền chỉ tr&iacute;ch nhưng lại thu h&uacute;t sự ch&uacute; &yacute; của dư luận.</p>\r\n\r\n<p>C&aacute;c nh&oacute;m nh&acirc;n quyền cho rằng h&agrave;nh động đ&aacute;nh đ&ograve;n nơi c&ocirc;ng cộng l&agrave; một h&agrave;nh động t&agrave;n &aacute;c. Tổng thống Indonesia Joko Widodo cũng l&ecirc;n tiếng k&ecirc;u gọi chấm dứt h&agrave;nh động n&agrave;y. Tuy nhi&ecirc;n, n&oacute; lại nhận được sự ủng hộ mạnh mẽ của người d&acirc;n tỉnh Aceh.</p>\r\n\r\n<p>Kh&ocirc;ng giống như c&aacute;c địa phương kh&aacute;c của Indonesia, năm 2005, tỉnh Aceh đ&atilde; c&oacute; một thỏa thuận với ch&iacute;nh phủ trung ương để được ph&eacute;p tự trị v&agrave; tu&acirc;n theo luật t&ocirc;n gi&aacute;o.</p>', 201, '2022-01-14 20:34:03', '2022-01-14 20:34:52'),
(23, 'Khởi tố nhân viên Bệnh viện Thủ Đức và một giám đốc', 'khoi-to-nhan-vien-benh-vien-thu-duc-va-mot-giam-doc', 'upload/news/avatar/khoi-to-2-bi-can-trong-vu-benh-vien-thu-duc-mua-kit-test-cua-cong-ty-viet-a-1642239181219.jpeg', '<p>C&ocirc;ng an TPHCM đ&atilde; khởi tố vụ &aacute;n, khởi tố bị can, bắt tạm giam 2 người trong qu&aacute; tr&igrave;nh điều tra vụ việc mua b&aacute;n kit test của C&ocirc;ng ty Việt &Aacute;, li&ecirc;n quan đến Bệnh viện Thủ Đức v&agrave; C&ocirc;ng ty Nam Phong.</p>', '<p>Ng&agrave;y 15/1, Cơ quan CSĐT C&ocirc;ng an TPHCM đ&atilde; khởi tố bị can, bắt tạm giam Phạm Vũ Phong (Gi&aacute;m đốc c&ocirc;ng ty Nam Phong), Trương Thị Bảo Tr&acirc;n (nh&acirc;n vi&ecirc;n Ph&ograve;ng vật tư Bệnh viện Thủ Đức) về tội &quot;Vi phạm quy định về đấu thầu g&acirc;y hậu quả nghi&ecirc;m trọng&quot;, &quot;Đưa hối lộ&quot;, &quot;Nhận hối lộ&quot;, trong vụ &aacute;n li&ecirc;n quan đến C&ocirc;ng ty Việt &Aacute;, Bệnh viện Thủ Đức v&agrave; C&ocirc;ng ty Nam Phong.</p>\r\n\r\n<p>Thực hiện chỉ đạo của Thủ tướng Ch&iacute;nh phủ v&agrave; Bộ C&ocirc;ng an, C&ocirc;ng an TPHCM đ&atilde; tiến h&agrave;nh x&aacute;c minh, thu thập t&agrave;i liệu, bước đầu x&aacute;c định trong năm 2021, Bệnh viện Thủ Đức c&oacute; mua kit test PCR do C&ocirc;ng ty Việt &Aacute; sản xuất, th&ocirc;ng qua C&ocirc;ng ty Nam Phong.</p>\r\n\r\n<p><img alt=\"\" src=\"/upload/images/khoi-to-2-bi-can-trong-vu-benh-vien-thu-duc-mua-kit-test-cua-cong-ty-viet-a-1642239181219.jpeg\" style=\"height:513px; width:770px\" /></p>\r\n\r\n<p>Cụ thể, th&aacute;ng 2/2021 đến th&aacute;ng 9/2021, Bệnh viện Thủ Đức đ&atilde; mua kit test do C&ocirc;ng ty Việt &Aacute; sản xuất th&ocirc;ng qua C&ocirc;ng ty Nam Phong với tổng số tiền gần 34 tỷ đồng (đơn gi&aacute; 470.000 đến 509.250 đồng/kit) theo một g&oacute;i thầu với h&igrave;nh thức ch&agrave;o h&agrave;ng cạnh tranh, 37 g&oacute;i thầu với h&igrave;nh thức mua sắm chỉ định thầu r&uacute;t gọn.</p>\r\n\r\n<p>Việc Bệnh viện Thủ Đức mua kit test th&ocirc;ng qua C&ocirc;ng ty Nam Phong l&agrave; theo chỉ định của C&ocirc;ng ty Việt &Aacute;, với mục đ&iacute;ch n&acirc;ng gi&aacute; trước khi b&aacute;n v&agrave;o bệnh viện. Theo đ&oacute;, C&ocirc;ng ty Nam Phong được chiết khấu từ 30-40%, tương đương hơn 10 tỷ đồng.</p>\r\n\r\n<p>Để hợp thức h&oacute;a chỉ định thầu v&agrave; thanh to&aacute;n tiền cho C&ocirc;ng ty Nam Phong, c&aacute;c b&ecirc;n thỏa thuận sẽ chi cho Bệnh viện Thủ Đức theo tỷ lệ phần trăm gi&aacute; trị hợp đồng được thanh to&aacute;n.</p>\r\n\r\n<p>Kết quả điều tra bước đầu x&aacute;c định, từ th&aacute;ng 8/2021 đến th&aacute;ng 12/2021, Phong đ&atilde; chi cho Tr&acirc;n hơn 990 triệu đồng.</p>\r\n\r\n<p>Ngo&agrave;i ra, để hợp thức h&oacute;a cho hồ sơ chỉ định thầu, Bệnh viện Thủ Đức y&ecirc;u cầu v&agrave; hướng dẫn C&ocirc;ng ty Nam Phong l&agrave;m 3 bảng b&aacute;o gi&aacute; do c&aacute;c c&ocirc;ng ty của người quen Phong đứng t&ecirc;n. Sau đ&oacute;, Bệnh viện Thủ Đức hợp thức h&oacute;a thủ tục chỉ định thầu cho C&ocirc;ng ty Nam Phong, đồng thời n&acirc;ng đơn gi&aacute; b&aacute;n kit test do C&ocirc;ng ty Việt &Aacute; sản xuất để hưởng hơn 10 tỷ đồng tiền hoa hồng, g&acirc;y thiệt hại cho Bệnh viện Thủ Đức, cũng l&agrave; t&agrave;i sản Nh&agrave; nước đối với to&agrave;n bộ số tiền n&agrave;y.</p>\r\n\r\n<p>Tại cơ quan điều tra, Phong v&agrave; Tr&acirc;n đ&atilde; thừa nhận h&agrave;nh vi vi phạm của m&igrave;nh. Do Tr&acirc;n đang nu&ocirc;i con nhỏ dưới 36 th&aacute;ng tuổi n&ecirc;n cơ quan c&ocirc;ng an &aacute;p dụng biện ph&aacute;p cấm đi khỏi nơi cư tr&uacute;.</p>\r\n\r\n<p>Vụ &aacute;n đang được cơ quan c&ocirc;ng an điều tra mở rộng.</p>', 201, '2022-01-15 03:11:17', '2022-01-15 03:11:17');
