(67, 'Sen cây đặt sàn màu crom cho bồn tắm Miken MKSB-0238W', 'sen-cay-dat-san-mau-crom-cho-bon-tam-miken-mksb-0238w', 'upload/product/avatar/Miken MKSB-0238W-1.jpg', '8b8b5', '<p>Fuga aut pariatur est quos excepturi. Provident vitae quidem nam.</p>', '<p>Sen c&acirc;y đặt s&agrave;n m&agrave;u crom cho bồn tắm Miken MKSB-0238W Sen c&acirc;y đặt s&agrave;n mạ m&agrave;u Crom &Aacute;p lực nước: 0.05 MPa ~ 0.75 MPa Chất liệu chủ yếu: Đồng mạ crom Chất liệu lớp mạ: Niken, Crom K&iacute;ch thước: Cao 905mm ( Bản vẽ chi tiết đ&iacute;nh k&egrave;m) Ưu điểm sản phẩm C&oacute; 2 chế độ N&oacute;ng &ndash; Lạnh Lớp mạ bền vững với thời gian Thiết kế trang nh&atilde;, hiện đại Nước xả mạnh mẽ Đặt s&agrave;n nh&agrave; cho bồn tắm Xuất xứ H&atilde;ng sản xuất: Miken C&ocirc;ng nghệ sản xuất: Đức Sản xuất tại: Đ&agrave;i Loan Trung Quốc Cty Ho&agrave;ng Mai Việt Nam ph&acirc;n phối v&agrave; bảo h&agrave;nh</p>\r\n\r\n<p><img alt=\"\" src=\"/upload/images/JH834-4(1).jpg\" style=\"height:961px; width:1000px\" /></p>', 'Saepe in et saepe perspiciatis.', 'test', 'odio', 1, 1, 0, 0, 78291, NULL, 31608, 18976, 1, 1, 51, '2022-01-06 08:39:39', '2022-01-21 09:10:03'),
(68, 'Sen cây đặt sàn màu đen cho bồn tắm Miken MKSB-0238B', 'sen-cay-dat-san-mau-den-cho-bon-tam-miken-mksb-0238b', 'upload/product/avatar/Miken-MKSB-0238B-2.jpg', '8b8b5', '<p>Odit dolorem accusantium qui placeat error saepe consequatur. Aspernatur sequi quibusdam qui aut.</p>', '<p>Sen c&acirc;y đặt s&agrave;n m&agrave;u đen cho bồn tắm Miken MKSB-0238B Sen c&acirc;y đặt s&agrave;n mạ m&agrave;u đen (Black) &Aacute;p lực nước: 0.05 MPa ~ 0.75 MPa Chất liệu chủ yếu: Đồng mạ crom Chất liệu lớp mạ: Niken, Crom K&iacute;ch thước: Cao 905mm ( Bản vẽ chi tiết đ&iacute;nh k&egrave;m) Ưu điểm sản phẩm C&oacute; 2 chế độ N&oacute;ng &ndash; Lạnh Lớp mạ bền vững với thời gian Thiết kế trang nh&atilde;, hiện đại Nước xả mạnh mẽ Đặt s&agrave;n nh&agrave; cho bồn tắm Xuất xứ H&atilde;ng sản xuất: Miken C&ocirc;ng nghệ sản xuất: Đức Sản xuất tại: Đ&agrave;i Loan Trung Quốc Cty Ho&agrave;ng Mai Việt Nam ph&acirc;n phối v&agrave; bảo h&agrave;nh</p>', 'Esse eveniet eos ut aut esse sequi eaque.', 'undefined', 'illo', 1, 1, 0, 1, 89243, NULL, 52783, 65405, 0, 1, 74, '2022-01-06 08:39:39', '2022-01-15 02:09:24'),
(69, 'Sen cây đặt sàn màu đen cho bồn tắm Miken MKSB-0238B', 'sen-cay-dat-san-mau-den-cho-bon-tam-miken-mksb-0238b', 'upload/product/avatar/MKS-0992-4.jpg', '8b8b5', '<p>Qui ut suscipit quas distinctio. Tempora ut tempore doloribus. Aut corrupti ad quidem.</p>', '<p>Sen c&acirc;y đặt s&agrave;n cho bồn tắm m&agrave;u chrome Miken MKS-0992 &Aacute;p lực nước: 0.05 MPa ~ 0.75 MPa Chất liệu chủ yếu: Đồng mạ crom Chất liệu lớp mạ: Niken, Crom K&iacute;ch thước: Cao 980mm Ưu điểm sản phẩm C&oacute; 2 chế độ N&oacute;ng &ndash; Lạnh Lớp mạ bền vững với thời gian Thiết kế trang nh&atilde;, hiện đại Nước xả mạnh mẽ Đặt s&agrave;n nh&agrave; Xuất xứ sản phẩm H&atilde;ng sản xuất: Miken C&ocirc;ng nghệ sản xuất: Đức Nơi sản xuất: Trung Quốc</p>', 'Et sint eos tempora ut et quas quia.', 'undefined', 'animi', 1, 1, 1, 1, 88266, NULL, 71167, 15042, 0, 1, 68, '2022-01-06 08:39:39', '2022-01-15 02:05:16'),
(70, 'Bồn cầu nắp rửa điện tử Inax AC-918R-CW-H18VN', 'bon-cau-nap-rua-dien-tu-inax-ac-918r-cw-h18vn', 'upload/product/avatar/AC-918R-CW-H18VN.jpg', '8b8b5', 'Aut distinctio quis eius et quia porro. Omnis corrupti vel non quia earum in dicta tenetur.', 'Tên sản phẩm: Nắp rửa điện tử Inax\r\nModel: Inax AC-918R + CW-H18VN\r\nChất liệu : Sứ vệ sinh tráng men Aqua Ceramic.\r\nLoại: Bồn cầu 1 khối, két liền\r\nKích thước(RxDxC): 400 x 778 x 655 mm\r\nTâm xả: 300 mm\r\nỐng chờ thải: ∅110x4.2 (class 3 - TCVN)\r\nChế độ xả: xả gạt 1 chế độ siêu tiết kiệm nước 5L.\r\nNắp rửa thông minh: Phun rửa đại tiện, Vệ sinh phụ nữ, Phun rửa massage, Bệ ngồi sưởi ấm, Hút khử mùi tự động, Khí ấm sấy khô, Bảng điều khiển chữ nổi, Chống khuẩn.\r\nMàu sắc : Trắng\r\nCông nghệ: Dây chuyền sản xuất Nhật Bản.\r\nSản xuất tại nhà máy Inax Việt Nam.\r\n\r\nTính năng\r\nBồn cầu 1 khối Inax AC-918R có thiết kế mới, xả rửa thông minh.\r\nCông nghệ Aqua Ceramic 100 năm, giữ cho bồn cầu luôn trắng bóng và dễ dàng vệ sinh bám bẩn.\r\nKhả năng tiết kiệm nước tối ưu 5L\r\nKỹ thuật xả xoáy hút\r\nCông nghệ ECO-X\r\nĐã bao gồm van vặn khóa A-703-4, đế thải nước T-93V\r\nChống hình thành các vết ố do cặn khoáng\r\nNgăn ngừa vi khuẩn phát triển.\r\nNắp rửa điện tử Inax CW-H18VN tính năng : Phun rửa đại tiện, Vệ sinh phụ nữ, Phun rửa massage, Bệ ngồi sưởi ấm, Hút khử mùi tự động, Khí ấm sấy khô, Bảng điều khiển chữ nổi, Chống khuẩn.\r\nThiết bị an toàn: Rơ-le nhiệt, cảm ứng từ kiểm soát nhiệt độ cao, phao ngắt để thiết bị ngừng hoạt động khi không đủ nước, cảm ứng tự ngắt khi gặp sự cố.\r\nChế độ tiết kiệm điện: Siêu tiết kiệm điện 24h. Tiết kiệm điện “1 lần chạm” (8 tiếng sau tự khôi phục).\r\nNước cấp: Nối trực tiếp từ đường ống nước\r\nĐiều chỉnh nhiệt độ: Điều chỉnh 6 mức\r\nThiết bị an toàn: Rơ-le nhiệt.\r\nNắp đóng êm.\r\nPhụ kiện đi kèm\r\n\r\nCao su non\r\nDây cấp nước\r\nVan chặn nước\r\nPhụ kiện bắt sàn\r\nĐế thải\r\ngiấy lắp đặt và sử dụng', 'Ipsa et culpa quam est optio.', 'undefined', 'corporis', 1, 1, 0, 1, 90003, NULL, 77499, 66606, 1, 1, 98, '2022-01-06 08:39:39', '2022-01-10 07:50:06'),
(71, 'Bồn cầu nắp rửa điện tử Inax AC-514A-CW-H18VN', 'bon-cau-nap-rua-dien-tu-inax-ac-514a-cw-h18vn', 'upload/product/avatar/AC-514A-CW-H18VN.jpg', '8b8b5', 'Porro et ullam eum est. Ratione facere sequi iusto officiis. Minima ut dolor quisquam.', 'Bồn cầu nắp rửa điện tử Inax AC-514A-CW-H18VN\r\nKích thước bồn cầu: 728x396x724 mm (DxRxC)\r\nKích thước: 536x472x173 mm (DxRxC)\r\nBao gồm đế thải nước PT-B102 và van khóa nước A-504V-4\r\nKiểu xả nhấn 2 mức nước: 4.8L/3.0L\r\nDung tích két nước nóng: 0.7L (lít)\r\nVòi phun rửa: Vòi phun rửa và vòi phun dùng riêng cho phụ nữ đều là loại trượt tự động.\r\nSố lỗ phun: 6 lỗ x 0.8mm\r\nNhiệt độ nước nóng: OFF:Nhiệt độ nước cấp; LOW: ~32oC; MID: ~36oC; HIGH: ~40oC\r\nThiết bị an toàn: Rơ-le nhiệt, cầu chì điện, cảm biến nhiệt độ, chống dò điện.\r\nChế độ tiết kiệm điện: Siêu tiết kiệm điện 24h.Tiết kiệm điện “1 lần chạm” (8 tiếng sau tự khôi phục).\r\nÁp suất nước cấp: 0.06 - 0.75MPa\r\nNguồn điện: AC 220V, 336W, 50Hz\r\nTrọng lượng: ~4kg\r\nĐiều chỉnh nhiệt độ: Điều chỉnh 6 mức\r\nChế độ hút mùi hôi: Tự động, mạnh, siêu mạnh\r\nXuất xứ: Việt Nam\r\n\r\nChức năng bàn cầu thông minh Inax AC-514A/CW-H18VN\r\nDòng sản phẩm bồn cầu cao cấp kết hợp nắp rửa điện tử đến từ thương hiệu thiết bị vệ sinh INAX\r\nBệt Inax với thiết kế mới đơn giản, gọn gàng và sang trọng hơn kết hợp với những tính năng cải tiến\r\nPhun rửa tự động\r\nVệ sinh phụ nữ\r\nSấy khô và khử mùi nhanh\r\nCó chức năng sưởi ấm bệ ngồi\r\nTiết kiệm điện\r\n\r\nHãng sản xuất: INAX', 'Praesentium illum sapiente vel ut.', 'undefined', 'consectetur', 1, 1, 1, 0, 1544, NULL, 79780, 55458, 0, 1, 82, '2022-01-06 08:39:39', '2022-01-10 07:52:53'),
(72, 'Bồn cầu nam', 'bon-cau-nam', 'upload/product/avatar/JH834-1.jpg', '8b8b5', '<p>Đ&acirc;y l&agrave; nội dung m&ocirc; tả ngắn n&ecirc;n viết ngắn 3 đến 5 d&ograve;ng, kh&ocirc;ng th&ecirc;m ảnh v&agrave;o v&ugrave;ng n&agrave;y</p>', '<p>Đ&acirc;y l&agrave; nội dung chi tiết. C&oacute; thể th&ecirc;m ảnh v&agrave;o v&ugrave;ng n&agrave;y</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt=\"\" src=\"/upload/images/JH834-1.jpg\" style=\"height:1200px; width:1199px\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt=\"\" src=\"/upload/images/JH834-3.jpg\" style=\"height:1041px; width:723px\" /></p>\r\n\r\n<p><img alt=\"\" src=\"/upload/images/JH834-4.jpg\" style=\"height:961px; width:1000px\" /></p>\r\n\r\n<p><img alt=\"\" src=\"/upload/images/JH834-5.jpg\" style=\"height:1200px; width:1133px\" /></p>\r\n\r\n<p><img alt=\"\" src=\"/upload/images/JH834-6.jpg\" style=\"height:638px; width:641px\" /></p>\r\n\r\n<p><img alt=\"\" src=\"/upload/images/JH834-12.jpg\" style=\"height:905px; width:790px\" /></p>', 'Bồn cầu nam', 'undefined', 'Bồn cầu nam', 1, 0, 1, 0, 4623, NULL, 84801, 68462, 0, 1, 75, '2022-01-06 08:39:39', '2022-01-15 02:06:27'),
